import java.util.Scanner;

public class HarshadNumber {

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        sc.close();

        int sumOfDigits = 0;
        int tempN = N;
        while (tempN > 0) {
            sumOfDigits += tempN % 10;
            tempN /= 10;
        }

        if (N % sumOfDigits == 0) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }
    }
}

