        for (long h = 1; h <= 3500; h++) {
            for (long num = 1; num <= 3500; num++) {
                long numerator = n * h * num;
                long denominator = 4 * h * num - n * num - n * h;

                if (denominator > 0 && numerator % denominator == 0) {
                    long w = numerator / denominator;
                    if (w > 0) {
                        System.out.println(h + " " + num + " " + w);
                        return;
                    }
                }
            }
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int[] p = new int[N];
        for (int i = 0; i < N; i++) {
            p[i] = sc.nextInt();
        }
        sc.close();

        int operations = 0;
        for (int i = 0; i < N; i++) {
            if (p[i] == i + 1) {
                operations++;
                if (i + 1 < N) {
                    i++;
                }
            }
        }
        System.out.println(operations);
    }
}

