import java.util.Scanner;
import java.util.Arrays;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long A = sc.nextLong();
        long B = sc.nextLong();
        long[] h = new long[N];
        for (int i = 0; i < N; i++) {
            h[i] = sc.nextLong();
        }

        long diff = A - B;

        long left = 0;
        long right = 2_000_000_000L;

        long ans = right;

        while (left <= right) {
            long mid = left + (right - left) / 2;
            long totalDamageFromB = mid * B;
            long neededAAttacks = 0;

            for (int i = 0; i < N; i++) {
                if (h[i] > totalDamageFromB) {
                    neededAAttacks += (h[i] - totalDamageFromB + diff - 1) / diff;
                }
            }

            if (neededAAttacks <= mid) {
                ans = mid;
                right = mid - 1;
            } else {
                left = mid + 1;
            }
        }

        System.out.println(ans);

        sc.close();
    }
}

