import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();
        long[] x = new long[n];
        long[] y = new long[m];
        for (int i = 0; i < n; i++) {
            x[i] = sc.nextLong();
        }
        for (int i = 0; i < m; i++) {
            y[i] = sc.nextLong();
        }
        sc.close();

        long MOD = 1000000007;

        long sumXDiff = 0;
        for (int i = 0; i < n; i++) {
            sumXDiff = (sumXDiff + (2L * i - (n - 1)) * x[i]) % MOD;
        }

        long sumYDiff = 0;
        for (int i = 0; i < m; i++) {
            sumYDiff = (sumYDiff + (2L * i - (m - 1)) * y[i]) % MOD;
        }

        long totalArea = (sumXDiff * sumYDiff) % MOD;

        if (totalArea < 0) {
            totalArea += MOD;
        }

        System.out.println(totalArea);
    }
}

