import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        String S = sc.next();

        int[] prefixW = new int[N + 1];
        int[] suffixE = new int[N + 1];

        for (int i = 0; i < N; i++) {
            prefixW[i + 1] = prefixW[i] + (S.charAt(i) == 'W' ? 1 : 0);
        }
        for (int i = N - 1; i >= 0; i--) {
            suffixE[i] = suffixE[i + 1] + (S.charAt(i) == 'E' ? 1 : 0);
        }

        int ans = Integer.MAX_VALUE;
        for (int i = 0; i < N; i++) {
            int turns = prefixW[i] + suffixE[i + 1];
            ans = Math.min(ans, turns);
        }
        System.out.println(ans);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        String S = sc.next();

        int[] prefixW = new int[N + 1];
        int[] suffixE = new int[N + 1];

        for (int i = 0; i < N; i++) {
            prefixW[i + 1] = prefixW[i] + (S.charAt(i) == 'W' ? 1 : 0);
        }
        for (int i = N - 1; i >= 0; i--) {
            suffixE[i] = suffixE[i + 1] + (S.charAt(i) == 'E' ? 1 : 0);
        }

        int minChange = Integer.MAX_VALUE;
        for (int i = 0; i < N; i++) {
            int changes = prefixW[i] + suffixE[i + 1];
            minChange = Math.min(minChange, changes);
        }

        System.out.println(minChange);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        int sum = 0;
        int temp = N;
        while (temp > 0) {
            sum += temp % 10;
            temp /= 10;
        }

        if (N % sum == 0) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }
    }
}

