import java.util.*;

public class Main {
    static final long MOD = 1000000007L;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        String S1 = sc.next();
        String S2 = sc.next();

        long ans = 1;
        int i = 0;
        int prev = -1;

        while (i < N) {
            if (S1.charAt(i) == S2.charAt(i)) {
                if (i == 0) {
                    ans = (ans * 3) % MOD;
                } else {
                    if (prev == 0) {
                        ans = (ans * 2) % MOD;
                    } else {
                        ans = (ans * 1) % MOD;
                    }
                }
                prev = 0;
                i++;
            } else {
                if (i == 0) {
                    ans = (ans * 6) % MOD;
                } else {
                    if (prev == 0) {
                        ans = (ans * 2) % MOD;
                    } else {
                        ans = (ans * 3) % MOD;
                    }
                }
                prev = 1;
                i += 2;
            }
        }
        System.out.println(ans);
    }
}

