public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        String s = sc.next();
        int n = s.length();

        int moves = 0;
        for (int i = 1; i < n - 1; i++) {
            if (s.charAt(i - 1) != s.charAt(i + 1)) {
                moves++;
            }
        }

        System.out.println(moves % 2 == 1 ? "First" : "Second");
    }
}

