import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long[] T = new long[N];
        long[] A = new long[N];
        for (int i = 0; i < N; i++) {
            T[i] = sc.nextLong();
            A[i] = sc.nextLong();
        }

        long tVotes = T[0];
        long aVotes = A[0];

        for (int i = 1; i < N; i++) {
            long t = T[i];
            long a = A[i];
            long k1 = (tVotes + t - 1) / t;
            long k2 = (aVotes + a - 1) / a;
            long k = Math.max(k1, k2);
            tVotes = t * k;
            aVotes = a * k;
        }

        System.out.println(tVotes + aVotes);
    }
}

