import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        int A = sc.nextInt();
        int[] x = new int[N];
        for (int i = 0; i < N; i++) x[i] = sc.nextInt();

        long[][][] dp = new long[N + 1][N + 1][N * 50 + 1];
        dp[0][0][0] = 1;

        for (int i = 0; i < N; i++) {
            for (int k = 0; k <= i; k++) {
                for (int s = 0; s <= N * 50; s++) {
                    if (dp[i][k][s] == 0) continue;
                    dp[i + 1][k][s] += dp[i][k][s];
                    if (s + x[i] <= N * 50)
                        dp[i + 1][k + 1][s + x[i]] += dp[i][k][s];
                }
            }
        }

        long ans = 0;
        for (int k = 1; k <= N; k++) {
            int sum = k * A;
            if (sum <= N * 50)
                ans += dp[N][k][sum];
        }
        System.out.println(ans);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

