import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }

        int totalCost = Math.abs(a[0]);
        for (int i = 1; i < n; i++) {
            totalCost += Math.abs(a[i] - a[i-1]);
        }
        totalCost += Math.abs(a[n-1]);

        for (int i = 0; i < n; i++) {
            int costWithoutI = totalCost;

            if (i == 0) {
                costWithoutI -= Math.abs(a[0]);
                if (n > 1) {
                    costWithoutI -= Math.abs(a[1] - a[0]);
                    costWithoutI += Math.abs(a[1]);
                }
            } else if (i == n - 1) {
                costWithoutI -= Math.abs(a[n-1] - a[n-2]);
                costWithoutI -= Math.abs(a[n-1]);
                costWithoutI += Math.abs(a[n-2]);
            } else {
                costWithoutI -= Math.abs(a[i] - a[i-1]);
                costWithoutI -= Math.abs(a[i+1] - a[i]);
                costWithoutI += Math.abs(a[i+1] - a[i-1]);
            }

            System.out.println(costWithoutI);
        }

        sc.close();
    }
}

