                if (n > 1) {
                    costWhenSkipping -= Math.abs(a[1] - a[0]);
                    costWhenSkipping += Math.abs(a[1]);
                }
            } else if (i == n - 1) {
                costWhenSkipping -= Math.abs(a[n-1] - a[n-2]);
                costWhenSkipping -= Math.abs(a[n-1]);
                costWhenSkipping += Math.abs(a[n-2]);
            } else {
                costWhenSkipping -= Math.abs(a[i] - a[i-1]);
                costWhenSkipping -= Math.abs(a[i+1] - a[i]);
                costWhenSkipping += Math.abs(a[i+1] - a[i-1]);
            }

            System.out.println(costWhenSkipping);
        }

        sc.close();
    }
