import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[] a = new int[n];

        for (int i = 0; i < n; i++) {
            a[i] = sc.nextInt();
        }

        int totalCost = Math.abs(a[0]);
        for (int i = 1; i < n; i++) {
            totalCost += Math.abs(a[i] - a[i-1]);
        }
        totalCost += Math.abs(a[n-1]);

        for (int skip = 0; skip < n; skip++) {
            int cost = totalCost;

            if (skip == 0) {
                cost -= Math.abs(a[0]);
                if (n > 1) {
                    cost -= Math.abs(a[1] - a[0]);
                    cost += Math.abs(a[1]);
                }
            } else if (skip == n - 1) {
                cost -= Math.abs(a[n-1] - a[n-2]);
                cost -= Math.abs(a[n-1]);
                cost += Math.abs(a[n-2]);
            } else {
                cost -= Math.abs(a[skip] - a[skip-1]);
                cost -= Math.abs(a[skip+1] - a[skip]);
                cost += Math.abs(a[skip+1] - a[skip-1]);
            }

            System.out.println(cost);
        }

        sc.close();
    }
}

