import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        int digitSum = 0;
        int temp = N;
        while (temp > 0) {
            digitSum += temp % 10;
            temp /= 10;
        }

        if (N % digitSum == 0) {
            System.out.println("Yes");
        } else {
            System.out.println("No");
        }

        sc.close();
    }
}

