        for (int h = 1; h <= 3500; h++) {
            for (int n = 1; n <= 3500; n++) {

                long numerator = (long) N * h * n;
                long denominator = 4L * h * n - (long) N * n - (long) N * h;

                if (denominator > 0 && numerator % denominator == 0) {
                    long w = numerator / denominator;
                    if (w > 0) {
                        System.out.println(h + " " + n + " " + w);
                        return;
                    }
                }
            }
        }
    }
