import java.util.*;

public class Main {
    static final long MOD = 1000000007;

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int m = sc.nextInt();

        long[] x = new long[n];
        long[] y = new long[m];

        for (int i = 0; i < n; i++) {
            x[i] = sc.nextLong();
        }

        for (int i = 0; i < m; i++) {
            y[i] = sc.nextLong();
        }

        long widthSum = 0;
        for (int j = 0; j < n; j++) {
            long coeff = (2L * (j + 1) - n - 1) % MOD;
            widthSum = (widthSum + coeff * (x[j] % MOD)) % MOD;
        }

        long heightSum = 0;
        for (int l = 0; l < m; l++) {
            long coeff = (2L * (l + 1) - m - 1) % MOD;
            heightSum = (heightSum + coeff * (y[l] % MOD)) % MOD;
        }

        widthSum = (widthSum % MOD + MOD) % MOD;
        heightSum = (heightSum % MOD + MOD) % MOD;

        long result = (widthSum * heightSum) % MOD;
        System.out.println(result);
    }
}

