        long H = sc.nextLong();
        long W = sc.nextLong();
        int N = sc.nextInt();

        Set blackCells = new HashSet<>();
        Set candidateRects = new HashSet<>();

        for (int i = 0; i < N; i++) {
            long a = sc.nextLong();
            long b = sc.nextLong();
            blackCells.add(a + "," + b);

            for (long dr = -2; dr <= 0; dr++) {
                for (long dc = -2; dc <= 0; dc++) {
                    long topRow = a + dr;
                    long leftCol = b + dc;
                    if (topRow >= 1 && topRow <= H - 2 && leftCol >= 1 && leftCol <= W - 2) {
                        candidateRects.add(topRow + "," + leftCol);
                    }
                }
            }
        }

        long[] count = new long[10];

        for (String rect : candidateRects) {
            String[] parts = rect.split(",");
            long topRow = Long.parseLong(parts[0]);
            long leftCol = Long.parseLong(parts[1]);

            int blackCount = 0;
            for (long r = topRow; r < topRow + 3; r++) {
                for (long c = leftCol; c < leftCol + 3; c++) {
                    if (blackCells.contains(r + "," + c)) {
                        blackCount++;
                    }
                }
            }
            count[blackCount]++;
        }

        long totalRects = (H - 2) * (W - 2);
        count[0] = totalRects - candidateRects.size();

        for (int i = 0; i < 10; i++) {
            System.out.println(count[i]);
        }
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int A = sc.nextInt();

        int[] x = new int[N];
        for (int i = 0; i < N; i++) {
            x[i] = sc.nextInt();
        }

        long count = 0;

        for (int mask = 1; mask < (1 << N); mask++) {
            int sum = 0;
            int cnt = 0;

            for (int i = 0; i < N; i++) {
                if ((mask & (1 << i)) != 0) {
                    sum += x[i];
                    cnt++;
                }
            }

            if (sum == A * cnt) {
                count++;
            }
        }

        System.out.println(count);
    }
}

