        for (int mask = 1; mask < (1 << N); mask++) {
            int sum = 0;
            int cardCount = 0;

            for (int i = 0; i < N; i++) {
                if ((mask & (1 << i)) != 0) {
                    sum += x[i];
                    cardCount++;
                }
            }

            if (sum == A * cardCount) {
                count++;
            }
        }

        System.out.println(count);
    }
}

import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        String S = sc.next();

        int[] prefixW = new int[N + 1];
        int[] suffixE = new int[N + 1];

        for (int i = 0; i < N; i++) {
            prefixW[i + 1] = prefixW[i] + (S.charAt(i) == 'W' ? 1 : 0);
        }

        for (int i = N - 1; i >= 0; i--) {
            suffixE[i] = suffixE[i + 1] + (S.charAt(i) == 'E' ? 1 : 0);
        }

        int minChanges = Integer.MAX_VALUE;
        for (int i = 0; i < N; i++) {
            int changes = prefixW[i] + suffixE[i + 1];
            if (changes < minChanges) {
                minChanges = changes;
            }
        }

        System.out.println(minChanges);
    }
}

