import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        int A = sc.nextInt();
        int[] x = new int[N];
        for (int i = 0; i < N; i++) {
            x[i] = sc.nextInt();
        }

        long[][][] dp = new long[N + 1][N + 1][N * 50 + 1];
        dp[0][0][0] = 1;

        for (int i = 1; i <= N; i++) {
            int num = x[i - 1];
            for (int j = 0; j <= N; j++) {
                for (int k = 0; k <= N * 50; k++) {
                    dp[i][j][k] = dp[i - 1][j][k];
                    if (j >= 1 && k >= num) {
                        dp[i][j][k] += dp[i - 1][j - 1][k - num];
                    }
                }
            }
        }

        long res = 0;
        for (int j = 1; j <= N; j++) {
            int target = A * j;
            if (target <= N * 50) {
                res += dp[N][j][target];
            }
        }

        System.out.println(res);
    }
}

