import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        String s = scanner.next();
        int n = s.length();
        int a = -1, b = -1;

        for (int i = 0; i < n - 1; i++) {
            if (s.charAt(i) == s.charAt(i + 1)) {
                a = i + 1;
                b = i + 2;
                break;
            }
        }

        if (a == -1) {
            for (int i = 0; i < n - 2; i++) {
                if (s.charAt(i) == s.charAt(i + 2)) {
                    a = i + 1;
                    b = i + 3;
                    break;
                }
            }
        }

        System.out.println(a + " " + b);
    }
}

